import Vue from "vue";
import VueRouter from "vue-router";
import HomeView from "../views/HomeView.vue";
import BeforeVersion from "../views/BeforeVersion.vue";
Vue.use(VueRouter);

const routes = [
  {
    path: "/",
    redirect: "/app-download",
  },

  {
    path: "/app-download",
    name: "home",
    component: BeforeVersion,
  },
  {
    path: "/app-download-pre",
    name: "home",
    component: HomeView,
  },
];

const router = new VueRouter({
  mode: "history",
  base: process.env.BASE_URL,
  routes,
});

export default router;
